  `tags` varchar(255) DEFAULT NULL,
  `outline` varchar(255) DEFAULT NULL,
  `site_id` varchar(36) DEFAULT NULL,
  `catName` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
