/*Data for the table `cms_articledata` */

insert  into `cms_articledata`(`id`,`lobContent`) values ('035e1f8b-2b73-4f7b-a672-4ab86749dff3','<p>cc</p>\r\n'),('16bb04d9-782b-4584-acdb-d33a888dd2ae','<p>ggg</p>\r\n'),('199c2506-6916-49b9-a5fd-52f3c23435be','<p>sdasd</p>\r\n'),('1ef6cd6d-62e5-4a85-ab6b-e17de195ae86','<p><img alt=\"\" src=\"http://localhost:8080/common/upload/image/20140505/3ceefc80-c4a0-414e-8c27-319416b07b39.gif\" style=\"height:288px; width:202px\" /></p>\r\n测试使用情况。如无问题，则以这个为模版'),('255f9877-2174-4075-87f7-d11974f990e8','<p>rrr</p>\r\n'),('2bda9c03-e1fe-43ed-9ad5-f64c8ec1d2d0','<p>稍不留神跑到了第一，身为国家级贫困县区，每次家乡上新闻基本都是因为穷或者苦。</p>\r\n\r\n<p><span style=\"color:rgb(34, 34, 34)\">第一次获得如此多的赞同，让我窃喜的同时又黯然神伤。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">当然这些事情最近的也有两三年了，有些是比较久远的事了，先在因为农村合作医疗的普及，比以前好了很多。另外大家的收入也普遍提高了。但是贫穷依然还远远没有真正的摆脱。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">没有课桌的小学，不通自来水，一到旱天就要几十里背水的村庄。依然存在着。当然随着社会的发展，都在变好，不论快慢。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">现在政府的解决方案就是合村，把小村合成大村，逐级外迁。希望以后这样的事情越来越少。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">其实这些穷人也不是大多数的情况，这几个人也是属于我见过的人中最穷或者最惨的那一部分。其他大部分人都没有那么苦了。我只是描述出来给大家看看，真正的穷有多可怕。我家的话因为比较愿意出来闯，没有那么穷，已经把家里的地送给别人，搬到县城住了。但老家确实还有一批相当穷的人。</span><br />\r\n&nbsp;</p>\r\n\r\n<p>对于贫穷的人来说，太遥远的事不敢想也不敢去做，孩子上学收益是未知的，但付出是确定的，对于有能力的人来说，搏一把，失败了无所谓，但是对于穷又没有能力的人来说就是孤注一掷了。所以选择打工的远比上学的多。</p>\r\n\r\n<p>以前上学的时候，8岁起就要每天翻两座山包六趟去读书。12岁起就要每周步行三四十里山路去读书，年龄更大些就更远了，有的同学从学校回家要坐几个小时的大巴。所以都是一学期回家一次，但是对于十几岁的小孩来说，这实在是太苦了。所以很多人就选择了不读书，打工。</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>大概十来年前的事，同村的一个光棍，孤儿，被倒下来的土墙拍了一下。当时头都软了，拿布包了下，去医院看了，医院说头骨碎了，需要几万块，这人说没有，就简单处理下回家等死，然后就死了。<br />\r\n大学时候去医院里，碰见一个人，腹水，瘦的骨架一样，挺个篮球一样的大肚子，医生说你这个要住院啊，他说没钱啊，医生叹了口气，说你这个就没办法了，这个人就摇摇晃晃回家了，手里还拿个小凳子，走一段就坐下来歇歇。<br />\r\n前几年外村的一个老人，得了重病，听说要花很多钱，可他知道孩子穷，就上吊自杀了。<br />\r\n以前村里有一座空宅，老人都不允许靠近。因为哪一家人得了肺结核，又穷，那时候好像没有免费治疗，而且就算有他们连路费都出不起，后面就全家死光了，好像剩下一个远走他乡了。<br />\r\n我看了几个高票答案，看来知乎上的群体收入层次比较高，都没见过真正的贫穷，真正的贫穷根本来不及考虑所谓教育，眼界，出路，真正的贫穷就是一不小心，就死了。</p>\r\n'),('b1bba64c-f868-43d7-b20f-d24649ff9631','<p><span style=\"color:rgb(34, 34, 34)\">八百多年前，有个叫管仲的人，看到周室衰微、诸侯内讧、夷狄四起、天下大乱。丫没有怀着理想主义情绪专门跑到成周洛阳去请求辅佐周天子，而是很现实地参与齐国的内斗，阴差阳错被曾经的政敌重用，最终成为齐国的相国，辅佐齐桓公成就了一番霸业。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">这霸业是什么？</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">就是&ldquo;尊王攘夷&rdquo;，让齐桓公会盟诸侯，尊崇周天子，复辟被戎狄消灭的诸侯国，最大限度地恢复周朝原有的秩序。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">至于有没有给齐国增加什么好处？</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">几乎没有。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">齐桓公虽贵为霸主，征伐遍及天下，北到孤竹西到流沙，几乎比他之前任何一个华夏帝王的征讨范围都要广阔，在出兵范围之广上，善战的商王武丁和周穆王都似乎不及于他。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">然而齐桓公为自己的封地齐国方面，开疆拓土的贡献几乎还不如他那个以乱伦昏聩而闻名的哥哥齐襄公&hellip;&hellip;，相对于其他的春秋五霸，齐桓公简直人畜无害小白兔。齐桓公的霸业，实实在在收益的是所有的华夏诸侯和周天子，齐国获得的只有虚名，虽然虚名自然也有用。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">所以孔子曰：&ldquo; 晋文公谲而不正，齐桓公正而不谲 。&rdquo;</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">这几乎都是管仲的功劳。</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">所以孔子又说：&ldquo;管仲相桓公，霸诸侯，一匡天下，民到于今受其赐。微管仲，吾其被发左衽矣。&rdquo;</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">所以在每个士人都将管仲当做人生目标学习和奋斗的时候，荀彧将眼前这个叫曹操的的大胡子臆想成自己人生中的齐桓公，还是很有可能的。</span></p>\r\n'),('beddee56-299b-4bc7-b551-4f225cdf2d9e','<p><span style=\"color:rgb(34, 34, 34)\">娱乐完之后，继续学习</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">完成一部分的定额，就得到奖励</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">把看似很大的任务，拆分成简单无比的小任务，就很容易做到最后</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">这是因为，</span><strong>积分法把学习反馈的频率，降低到了一个适合自己反馈周期的程度</strong><br />\r\n<br />\r\n<span style=\"color:rgb(34, 34, 34)\">别忘了给自己一个休息娱乐的指标</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">&mdash;&mdash;</span><strong>比如平均每星期，可以无忧无虑痛快玩一天，不必有任何学习的想法</strong><br />\r\n<span style=\"color:rgb(34, 34, 34)\">那天的分数，就记作X即可</span><br />\r\n<span style=\"color:rgb(34, 34, 34)\">因为如果一直学下去，没有放松的休息日，我敢保证即使是钢铁的意志也会崩溃...</span></p>\r\n'),('bfac1b76-64de-4172-b015-f466d96cc8c8','<p>666</p>\r\n'),('dd6c1155-4c69-4ef6-9b23-dfa3633c949a','<p><img alt=\"\" src=\"http://localhost:8080/common/upload/image/20140505/0a167314-18b5-468b-a57f-45da1360d8f6.gif\" style=\"width: 190px; height: 310px;\" /><img alt=\"\" src=\"http://localhost:8080/common/upload/image/20140505/1b582f17-f750-4ca5-b68c-b28fdf07fac3.gif\" style=\"width: 210px; height: 225px;\" /></p>\r\n'),('f8ed6f40-df1e-41b4-8c32-925981287ee0','<p>yy</p>\r\n');

